import Draggable from "react-draggable";


export const Generals = () => {
  return (
    <div>
      <DraggableItem type="rectangle" />
      <DraggableItem type="circle" />
      <DraggableItem type="vector" />
    </div>
  );
};
type DraggableItemType = {
    type: 'rectangle' | 'circle' | 'vector'; 
  };
  const DraggableItem = ({ type }: DraggableItemType) => {
    let className = "mb-2 shape d-flex justify-content-center align-items-center";
  
  
    return (
      <Draggable>
        <div
          draggable
          onDragStart={(e) => {
            e.dataTransfer.setData("itemType", type);
          }}
          className={className}
          style={{
            width: '100px',
            height: '50px',
          }}
        >
          {type}
        </div>
      </Draggable>
    );
  };
